import React from 'react' 
import BaseLayout from '../components/layout/BaseLayout' 
import AboutMe from '../components/About/AboutMe' 
function About() { 
    return ( 
        <BaseLayout title="Learn more about Rijyan Hossain"> 
            <AboutMe /> 
        </BaseLayout> 
    ) 
} 

export default About;
